	var lambda_0 = 0.95
	var epsilon = 0.9
	var eta = 1e-7
	var rho = 1
	var DistLambda = function() { return lambda_0 }
	var DistMu = function(lambda) { return (epsilon * lambda) }

	var mu_0 = epsilon * lambda_0
	var nsamples = 100
	var ret = simLSBDS( tree, lambda_0, mu_0, eta, DistLambda, DistMu, rho )
	var dist = Infer ( { model: function() { lsbdsGoesUndetected( tree.age, lambda_0, mu_0, eta, DistLambda, DistMu, rho ) }, method: 'forward', samples: nsamples } )
	factor( - 2.0 * dist.score( false ) )
	return ret
}
var dist = Infer({method: 'SMC', particles: particles, model: model})
dist.normalizationConstant

